import React from "react";

class Users extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: ['Arina', 'Max', 'Sonya']
        }
    }

    render() {
        return (
            <tr>
                {this.state.users.map(user => <th>{user}</th>)}
                <input type="text"/>
            </tr>
        );
    }
}

export default Users;
